import React from "react";
import { observer } from "mobx-react-lite";
import todo from "src/store/todo";

const Carts = observer(() => {
  return (
    <div>
      {todo.todos.map((todo: any, index: number) => {
        return (
          <div key={index}>
            <input type="checkbox" />
            {todo.name}
            <button>x</button>
          </div>
        );
      })}
    </div>
  );
});
export default Carts;
